import React from 'react';
import { NavLink } from 'react-router-dom';

// styled-components imports
import styled from 'styled-components';

// MaterialUI
import { makeStyles } from '@material-ui/core/styles';

const StyledNavBar = styled.div `
  flex-grow: 1;

  #f-AppBar {
    width: 100%;
    position: fixed;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 1em;

    .f-LogoText {
      color: $wh;
      margin-left: 1em;
      background-color: $bl;
      padding: .5em;

      &:hover {
        text-decoration: none;
      }
    }

    #f-Toolbar {
      padding: 2em;
      text-align: right;

      .f-AppBarLinks {
        color: $wh;
        background-color: $bl;
        text-decoration: none;
        padding: .5em;
        font-family: $para;
        // margin: 0 1em;
      }
    }
  }
`

// MaterialUI makeStyles
const useStyles = makeStyles((theme) => ({
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function NavigationBar() {
  const classes = useStyles();

  return (
    <StyledNavBar>
      <div position="static" id="f-AppBar">
        {/* <h1 className="f-LogoText">nell hensey</h1> */}
        <NavLink className="f-LogoText" activeClassName="is-active" to="/"><p className="f-p">nell hensey</p></NavLink>
          <div id="f-Toolbar">
            {/* <NavLink className="f-AppBarLinks" activeClassName="is-active" to="/">
                home
            </NavLink> */}
            <NavLink className="f-AppBarLinks" activeClassName="is-active" to="/works">
                works
            </NavLink>
            <NavLink className="f-AppBarLinks" activeClassName="is-active" to="/about">
                bio
            </NavLink>
        </div>
      </div>
    </StyledNavBar>
  );
}
